import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component { 
	render() {
		return (
			<Router>
				<Switch>
					<Router path="/index"/>
					<Router path="/" />
				</Switch>
			</Router>
		);
	}
}

export default App;
